        renderer.setSize(window.innerWidth, window.innerHeight);
        renderer.shadowMap.enabled = true; // ✅ เปิดใช้งานเงา!
        renderer.shadowMap.type = THREE.PCFSoftShadowMap;
        document.body.appendChild(renderer.domElement);

        const scene = new THREE.Scene();

        // โหลด EXR background
        const loader = new THREE.EXRLoader();
        loader.load('https://aomphatch.github.io/madWork/docklands_01_1k.exr', function (texture) {
            texture.mapping = THREE.EquirectangularReflectionMapping;

            // ใช้เป็นพื้นหลัง
            scene.background = texture;

            // ใช้เป็น environment สำหรับ PBR materials
            scene.environment = texture;
        });

        // ✅ กล้อง
        const camera = new THREE.PerspectiveCamera(
            75,
            window.innerWidth / window.innerHeight,
            0.1,
            1000
        );
        camera.position.set(0, 2, 5);
        camera.lookAt(0, 0, 0);
        const controls = new THREE.OrbitControls(camera, renderer.domElement);

        // สร้างแสง Ambient Light

        directionalLight.shadow.mapSize.height = 1024;

        directionalLight.shadow.camera.right = 5;
        directionalLight.shadow.camera.top = 5;
        directionalLight.shadow.camera.bottom = -5;
        scene.add(directionalLight);

        const directionalLightHelper = new THREE.DirectionalLightHelper(directionalLight, 1);

            lightZ: directionalLight.position.z,

            exposure: renderer.toneMappingExposure // ใช้สำหรับควบคุมความสว่างของภาพรวม
        };

        const lightFolder = gui.addFolder('Directional Light');

        lightFolder.open();
